import React from 'react';

import './searchCity.css';

const SearchCity = () => (
    <div>
        <form>
            <input type="text" placeholder="Search City..." />
            <ul>
                <li>Test 1</li>
                <li>Test 2</li>
                <li>Test 3</li>
                <li>Test 4</li>
                <li>Test 5</li>
            </ul>
        </form>
    </div>
);



export default SearchCity;
